import Gif from "./Gif"
import { useEffect } from "react"
import getGifs from './services/getGifs'

export default function ListOfGifs({ keyword }) {
  const [gifs, setGifs] = useState([])

    useEffect(() => {
        getGifs({ keyword })
        .then(gifs => setGifs(gifs))
  }, [])

    return gifs.map(({id, title, url}) =>
        <Gif
            key={id}
            title={title}
            id={id}
            url={url}
        />
    )
}
